import React from 'react';

const BidCard = ({ auction }) => {
  const { purchasePrice } = auction.bids[0];
  const { currentHighestBid } = auction;
  const { address, images, _id: id } = auction.propertyOnSale;
  return <div></div>;
};

export default BidCard;
